import React from 'react';
import Gallery from "./Gallery";
import GallerItem from "./GalleryItem"

const Social = () => {

    const galleryItems = [
        {  title: "JSA Spring Banquet 2023", image: "Gallery1.png" },
        { title: "JSA Allen Art Museum Trip", image: "Gallery2.png" },
        { title: "JSA Language Table", image: "Gallery3.png" },
        { title: "Asian Night Market 2023", image: "Gallery4.png" },
        { title: "JSA Spring Banquet 2022", image: "Gallery5.png" },
        { title: "Asian Night Market 2022", image: "Gallery6.png" },
        { title: "JSA Origami Night", image: "Gallery7.png" },
     ];

     return (
       <div className="App">
         <Gallery items={galleryItems} />
       </div>
     );

};

export default Social;
